Latest #CovidVaccine research shows #Sinovac is ~85% effective at preventing #COVID19  hospitalization and deaths. #Sinopharm and #Covaxin are also inactivated vaccines (likely similar outcomes)

Study based on 10,000,000+ vaccinated people in Chile

